  \"Mapping Habitat and Potential Distributions of Invasive Plant Species on USFWS
  National Wildlife Refuges\",\n\t\"tracking_summary\": {\n\t\t\"total\": 8,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:44:30.067423\",\n\t\"name\": \"mapping-habitat-and-potential-distributions-of-invasive-plant-species-on-usfws-national-wi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Many invasive species ecologists prefer
  to use ecological niche models that rely on presence-only data and not make any
  assumptions on whether or not an absence point is truly an absence point. Presence-only
  models generally attempt to identify environmental similarities that are defined
  by the presence-points and/or compare them with the environmental background. They
  make no distinction between presence and absence, rather base predictions largely
  on verified occurrences. The purpose of the modeling efforts for this project is
  to provide useful information to selected U.S. National Wildlife Refuges (NWR) and
  public/private partners by building on existing datasets and new field surveys conducted
  under this project. Broadly summarized, the goals are to: Provide models/maps of
  the potential distribution and risk of particularly problematic invaders at two
  scales: (1) the extent of the participating NWR, and (2) the associated Landscape
  Conservation Cooperative (LCC). Identify the environmental conditions that facilitate
  invasions for participating National Wildlife Refuges and the associated LCC. Utilize
  proven spatial statistical methods for model training and evaluation. Provide some
  insight on distribution trends and response of each of the targeted species for
  participating NWRs and the associated LCC.\",\n\t\"license_title\": \"License Not
